import logo from '../resources/VAL_LOGO_STARTS.svg';
import './login.css';

function login() {

        return(    
        <div className="App">
            <header className="App-header">
            <object type="image/svg+xml" data={logo} className="App-logo" alt="logo" >  
            </object> 
        </header>
      </div>
      )

}

export default login;
